After building the CYK‐style charts just for the final symbol t25 (position 14), you see

  • In the S→NT74 NT76 option, NT76 can only end in one of {t7,t17,t9,t8,t28,t27}  
  • In the S→NT6 NT48 option, NT48 can only end in one of {t26,t24,t7,t15,t6,t27,t22,t10}  

None of these sets contains t25, so neither S‐production can cover the last terminal t25. Therefore the string is not in the language.  

